import { Layout } from "../components/Layout";
import { Link } from "next/link";

function BlogLink(props) {
  return (
    <li>
      <Link href={`/blog/${props.title}`}>
        <a>{props.children}</a>
      </Link>
    </li>
  );
}

function Blog() {
  return (
    <Layout>
      <h2>This is the blog page</h2>
      <ul>
        {/* {/* <BlogLink title="blog1">First Blog</BlogLink> */}
        {/* <BlogLink title="blog2">Second Blog</BlogLink> */}
        {/* <BlogLink title="blog3">Third Blog</BlogLink> */}
      </ul>
    </Layout>
  );
}

export default Blog;
